import React from 'react';

import "./style.css";

const Buttons = () => {

  

  return(
    <div className="buttons">
      <button className="button__profile">Профиль</button>
      <button className="button__chat">Чат</button>
      <button className="button__blog">Блог</button>
    </div>
  )
}

export default Buttons;
